import '../App.css';
import './header.scss'
import mobile from '../images/mobile.png';
import segment from '../images/segment.png';

function Header() {
    return (
    <div className='header'>
        <div className='headerBar'>
            <div className='headerTags'>
                <img src={segment} alt='burger icon'></img>
                <div className='assessmentText'>
                    Assessment
                </div>
                <hr  className='divider'/>
                <div className='myAssessmentsText'>
                    My Assessments
                </div>
            </div>
            <img src={mobile} alt='mobile icon' style={{ cursor: 'pointer' }}></img>
        </div>
    </div>
    );
}

export default Header;
